INSERT INTO `brief` VALUES (1,'2024-09-08 07:30:00.000000','2024-09-08 07:30:00.000000',1,'af1e0903-31f6-4409-9d53-b9c5b74b9fa7.mp3','af1e0903-31f6-4409-9d53-b9c5b74b9fa7.mp3','2024년 9월 8일 꿀모닝 브리핑을 시작합니다.안녕하세요. 어제 8일 서울 여의도 국회에서는 이화영 전 경기도 평화부지사가 박상용 검사 탄핵소추 사건과 관련해 청문회에 출석하여 의원들의 질문에 답변하는 시간이 있었습니다. 이 전 부지사는 검찰로부터 지속적이고 강압적인 회유와 압박을 받았다고 주장하며, 특히 김 전 회장과의 대면에서 여러 차례 비밀 대화가 이루어졌음을 명확히 했습니다. 이날 청문회에서 박 검사 사무실에서의 진술 세미나와 여러 차례의 음주 파티에 대해서도 언급되었으며, 이 전 부지사는 당시 분위기를 회상하며 검찰의 조사가 제대로 이루어지지 않았다고 강조했습니다. 또한 민주당은 내년 1월 시행 예정인 금융투자소득세에 대해 의원총회에서 활발한 논의가 진행 중인데, 정성호 의원이 이 세금의 폐지가 필요하다는 주장을 제기했습니다. 이는 특히 지난달 민주당의 토론회가 여론 악화에 영향을 미쳤다는 분석과 맞물려 있습니다. 이 대표는  개인 투자자들의 정서를 고려하며 유예 가능성도 함께 언급하고 있습니다. 전체적으로 정치권에서는 금투세의 운명이 중요한 이슈로 떠오르고 있습니다.','2024년 9월 8일 꿀모닝 브리핑을 시작합니다.어제 정치와 관련된 주요 뉴스가 있었어요. 먼저 의료대란 문제 해결을 둘러싸고 정부와 여당 간의 미묘한 갈등이 이어지고 있는데, 한동훈 국민의힘 대표가 윤 대통령과의 독대에 대한 기대를 나타내며 국감 준비를 하고 있다고 전해졌습니다. 이를 두고 강득구 더불어민주당 의원이 언급한 촛불승리 관련 사항도 주목받고 있으며, 무게감 있는 언론 보도가 이어졌습니다. 이렇게 여야 간의 의정 갈등이 이어지는 가운데, 국민의힘은 원외 당협위원장 연수를 준비 중이라고 합니다.'),(78,'2024-09-09 07:30:00.000000','2024-09-09 07:30:00.000000',1,'7f4d086c-edfa-42ef-ae35-52e0c406eaa6.mp3','a5bad449-a323-4a60-9407-b31d45e26ab5.mp3','2024년 9월 9일 꿀모닝 브리핑을 시작합니다.오늘의 뉴스는 최근 경북 지역 여행과 관련된 다양한 이야기로 시작해 보겠습니다. 지난주에 경북 상주를 출발해 성주, 구미, 군위를 여행한 경험이 담긴 보고서가 도착했습니다. 여행의 시작점인 안동의 도산온천에서 아침 일찍부터 뜨거운 온천탕을 즐길 수 있었던 것이 특히 인상 깊었다고 하네요. 도산온천은 역사적인 의미도 지니고 있어, 여행자들에게 특별한 경험을 안겨주었습니다. 또한, 성욕 저하의 문제도 주요 이슈로 떠올랐습니다. 성욕의 저하에는 수면 부족이나 우울증 같은 여러 가지 원인이 있을 수 있으며, 이에 따른 해결책이 필요하다고 합니다. 특히, 수면의 질을 개선하고, 우울증을 해소하기 위한 노력이 중요하다는 것이죠. 부부 또는 연인이 함께 시간을 보내면서 성생활 외에도 다양한 활동을 통해 즐거움을 나누는 것이 필요할 것 같습니다. 그리고 50대 스타들의 미모 관리 비법도 흥미로운 이야기입니다. 김서형은 과거 촬영에서 영양실조를 겪은 후 운동을 시작하며, 과식 후에는 요거트나 과일로 가벼운 식사를 즐긴다고 합니다. 배우 김완선은 꾸준한 스트레칭과 등산으로 몸매를 유지하고 있으며, 영원한 핏을 자랑하는 김혜수는 무결점 피부 관리 비결을 공유했어요. 엄정화는 탄수화물 섭취 시 단백질을 먼저 챙기며 식단 관리를 소홀히 하지 않고, 예지원은 요가를 통해 건강한 몸매를 유지하고 있습니다. 이러한 다양한 정보들은 우리의 삶과 건강에 많은 도움이 될 것으로 보입니다.','2024년 9월 9일 꿀모닝 브리핑을 시작합니다.최근 경북 지역을 여행한 보고서가 도착했습니다. 지난 9월 넷째 주, 안동의 도산온천을 시작으로 성주, 구미, 군위까지 다양한 장소를 둘러보았어요. 특히 도산온천은 아침 일찍 도착해 즐길 수 있는 온천의 매력으로 기억에 남습니다. 또, 성욕 저하에 대한 이야기도 있었습니다. 저하의 원인은 여러 가지인데, 특히 수면 부족이나 우울증이 큰 영향을 미친다고 해요. 이와 함께 부부나 연인 간의 건강한 성생활을 위해 다양한 노력이 필요하답니다. 마지막으로, 50대 스타들의 아름다움 관리 비법도 소개되었는데요. 김서형은 요거트와 과일로 건강한 식사를 즐기며, 김혜수는 피부 관리에 특히 신경을 쓴다고 밝혔어요. 이런 다양한 정보들이 우리의 일상에 도움이 될 것 같습니다.'),(79,'2024-09-10 07:30:00.000000','2024-09-10 07:30:00.000000',1,'fbcb465e-f79b-42dd-8c68-c86089f31679.mp3','89fb29a5-343a-4cd9-8b0a-1eaa7cc4c0b0.mp3','2024년 9월 10일 꿀모닝 브리핑을 시작합니다.어제 10일 코스피는 8.02포인트 상승해 2,569.71로 장을 마감한 반면, 코스닥은 6.85포인트 올라 768.98로 종료했어요. 국내 증시는 미국의 긍정적인 경제지표에 힘입어 반등의 가능성을 보이고 있죠. 외국인 투자자들은 3거래일 만에 매수 우위로 돌아섰지만, 기관은 연속으로 매도세를 유지했답니다. 최근 발표된 ADP 민간고용 지표의 호조와 비농업 고용 증가가 경기 우려를 해소하는 긍정적인 신호로 작용하였고, 이에 따라 반도체와 인공지능 관련주, 또 대형 기술주들이 일제히 상승세를 보였어요. 전문가들은 이번 주 한국 증시가 미국 증시에 맞춰 움직일 것이라고 전망하며, 특히 소비재와 금융 업종에서 트레이딩 기회가 열릴 것으로 내다보고 있습니다. 또한, 중동 위기의 최악 상황이 코스피 하락의 원인으로 지적되고 있는 가운데, 반도체 업종 회복 여부는 8일 삼성전자의 3분기 잠정실적 발표에 크게 좌우될 듯합니다. 더불어 유니드는 올해 총 영업이익을 1050억 원으로 예상하며, 평균 목표가를 12만8857원으로 제시했죠. 하이닉스의 경우, 반도체 사업부문에서 3분기 영업이익이 6.7조 원에 이를 것으로 전망되고 있어, 투자자들 사이에서 상당한 기대를 모으고 있어요. 이처럼 현재 한국 주식 시장은 여러 긍정적인 요소들 속에서 회복세를 보이고 있답니다.','2024년 9월 10일 꿀모닝 브리핑을 시작합니다.10일 국내 증시는 상승세를 보였으며, 코스피는 8.02포인트 오른 2,569.71로 마감했습니다. 코스닥도 6.85포인트 상승해 768.98로 종료했어요. 외국인은 3거래일 만에 매수로 돌아섰으나 기관은 순매도를 지속했어요. 증시면에서는 경기 불안감이 완화되고 있으며, 특히 반도체와 AI 관련주가 강세를 보였고, 8일 삼성전자의 3분기 실적 발표가 주목됩니다. 한편, 유니드는 올해 영업이익을 1050억 원으로 전망하며, 12만8857원의 목표가를 설정했어요. 하이닉스는 3분기 영업이익이 6.7조 원에 이를 것으로 예상하고 있습니다.'),(80,'2024-09-11 07:30:00.000000','2024-09-11 07:30:00.000000',1,'84a13721-48c0-4013-b033-814dafe990e2.mp3','3474abc6-1cf2-481a-8d54-ec118378e189.mp3','2024년 9월 11일 꿀모닝 브리핑을 시작합니다.어제 뉴욕 증시는 일제히 상승하며 마감했어요. 미국 경제가 연착륙할 것이라는 기대감이 커지고 있는 가운데 주식시장에 매수세가 몰렸고, 비농업 일자리 수치가 전월 대비 25만4000개 증가한 5751.07로 나타나면서 긍정적인 분위기를 만들었죠. 특히 기술주 중심의 나스닥 지수는 1.22% 상승한 1만8137.85로 거래를 마감했어요. 또한, 금리 인하 속도가 둔화될 것이라는 판단 아래 국채 금리가 급등하는 모습도 보여, 연방공개시장위원회가 다가오는 11월에 큰 결정을 내릴 것으로 예상되고 있습니다. 반면, 삼성전자는 3분기 영업이익이 9조1000억원으로 지난해 동기 대비 274.49% 증가했지만, 증권가의 예상치에는 크게 미치지 못하여 부회장이 이례적으로 사과의 메시지를 전달하기도 했어요. 삼성전자는 기술과 품질을 중시하며 고품질 경쟁력을 확보하기 위해 노력할 것이라고 언급했습니다. 마지막으로, 수년간의 침체를 겪었던 중국 증시가 최근 다시 활기를 띠고 있으며, 글로벌 명품 브랜드 LVMH는 아시아 시장에서의 매출 감소로 예상 실적이 하락세를 기록하고 있다는 소식도 전해졌습니다. 이처럼 여러 나라의 경제 지표와 기업들의 실적 지표가 다양한 변화를 보이고 있어서 귀추가 주목됩니다.','2024년 9월 11일 꿀모닝 브리핑을 시작합니다.어제 뉴욕 증시는 상승세로 마감했어요. 미국 경제가 안정세를 보일 것이라는 기대가 커지며 매수세가 증가했으며, 비농업 일자리 수치는 전월 대비 25만4000개 늘어난 5751.07로 집계되었죠. 한편, 삼성전자는 3분기 영업이익 잠정치를 9조1000억원으로 발표하며 예상보다 낮은 수치를 보였고, 부회장이 이례적으로 사과하기도 했습니다. 중국 증시는 최근 상승세를 기록하고 있으며, 글로벌 명품 브랜드 LVMH는 아시아 시장의 부진으로 실적에 부정적인 영향을 받고 있습니다.'),(81,'2024-09-12 07:30:00.000000','2024-09-12 07:30:00.000000',1,'595f0d54-af85-4062-aff5-46edefed3236.mp3','cbdfdd98-9519-4eda-9f85-f753a74bce7d.mp3','2024년 9월 12일 꿀모닝 브리핑을 시작합니다.안녕하세요, 오늘의 뉴스 브리핑을 시작하겠습니다. 먼저, 미슐랭 가이드에 관한 이야기입니다. 이 가이드는 프랑스의 유명한 타이어 제조업체인 미쉐린이 매년 서울과 부산의 추천 레스토랑을 발표하곤 하는데요, 최근 발표된 가이드에 따르면 안성재 셰프가 운영하는 모수 서울이 주목받고 있습니다. 안 셰프는 12세에 미국으로 이민을 갔고, 2017년에 한국으로 돌아온 후 CJ그룹의 투자를 받아 서울에 모수를 열었습니다. 또한, 미슐랭 가이드 외에도 다양한 레스토랑들이 높은 평가를 받고 있죠. 그 중에서도 여경래 셰프의 \'홍보각\'과 \'비아톨레도 파스타바\' 같은 곳은 가격대가 상당해 고급스러운 dining 경험을 제공하고 있습니다. 다음으로, 건강 관련 소식입니다. 최근 심사평가원의 통계에 따르면 무릎 퇴행성관절염으로 병원을 찾는 2040세대의 환자가 꾸준히 증가하고 있다는 소식이 전해졌습니다. 2014년 1만8470명에서 2023년에는 2만2591명으로 증가하며, 그 증가폭이 심상치 않다고 합니다. 이 나이대에서 관절염이 발생하면 단순한 신체적 문제를 넘어 사회생활과 정신적 부분에도 큰 영향을 줄 수 있습니다. 따라서 평소 적절한 체중 유지와 운동, 올바른 자세가 필수적이며, 초기에 증상이 나타나면 꼭 치료를 받아야 한다고 전문가들은 조언합니다. 마지막으로, F1 자동차 경주와 관련된 흥미로운 연재가 시작될 예정입니다. 이 연재에서는 레이서 세나의 역사적인 레이스와 그의 놀라운 여정을 다룰 계획입니다. 다양한 에피소드를 통해 팬들에게 다시 한번 감동을 줄 것으로 기대됩니다. 오늘의 뉴스는 여기까지입니다. 들어주셔서 감사합니다.','2024년 9월 12일 꿀모닝 브리핑을 시작합니다.안녕하십니까, 오늘 전해드릴 소식은 최근 미슐랭 가이드의 선정 및 비즈니스 통계와 관련된 소식들입니다. 프랑스의 미슐랑 가이드는 매년 서울과 부산의 미슐랭 레스토랑을 발표하였고, 특히 안성재 셰프의 \'모수 서울\'이 큰 관심을 받고 있습니다. 이어서 2040세대에서 무릎 퇴행성 관절염 환자가 급증하고 있다는 통계도 발표되었습니다. 이 연령대의 관절 건강에 주의를 기울여야 할 필요성이 더욱 커지고 있습니다. 마지막으로 F1 자동차 경주와 관련된 이야기로, 전설적인 레이서 세나의 이야기를 다룬 연재가 시작될 예정입니다. 오늘의 주요 소식은 여기까지입니다.'),(82,'2024-09-13 07:30:00.000000','2024-09-13 07:30:00.000000',1,'4f29b6b0-de2b-407b-aefe-6587bbb45dbc.mp3','66f17361-bac1-4e60-bb3d-fdb282cbc653.mp3','2024년 9월 13일 꿀모닝 브리핑을 시작합니다.삼성전자가 3분기 영업이익으로 10조4천439억원을 기록하며 기대 이상의 실적을 보여주었습니다. 이로 인해 하반기 업황 개선에 대한 기대감이 높아졌지만, 반도체 부문은 감소세를 보일 것이라는 전망이 나오고 있습니다. 또한 LG전자는 이번 분기 최대 매출을 올렸음에도 불구하고 물류비 급등과 마케팅 비용 증가로 영업이익이 줄어든 상황입니다. 하지만 LG전자는 다양한 사업군에서 매출 성장을 이어갈 계획을 세우고 있습니다. 특히 webOS 기반 콘텐츠 서비스의 성장이 두드러질 것으로 예상되며 이익 구조가 개선될 것이라는 전망이 나옵니다. 한편, 이동통신 3사 자회사의 알뜰폰 시장 점유율이 약 47%에 달하면서 불공정 경쟁 우려가 제기되고 있습니다. 과기정통부는 이통사 자회사의 시장 진입에 대해 규제를 설정했으나, 그 실효성에 대한 비판이 이어지고 있어 정부의 정책 재정립이 필요하다는 목소리가 높아지고 있습니다. 이 통신사들은 수익성을 감수하며 알뜰폰 사업을 진행하고 있어 향후 시장의 안정성을 위한 방안이 모색되어야 할 것으로 보입니다.','2024년 9월 13일 꿀모닝 브리핑을 시작합니다.삼성전자가 3분기 깜짝 실적을 발표했는데요, 영업이익이 10조4천439억원에 달했습니다. 그러나 반도체 부문은 감소할 것으로 예상되고 있어 우려가 커지고 있습니다. LG전자는 물류비와 마케팅 비용 증가로 영업이익이 줄었다고 밝혔고, 이에 따라 다양한 사업군의 맞춤형 수주활동을 강화할 계획입니다. 한편, 이동통신 3사의 자회사가 알뜰폰 시장에서 점유율이 47%에 육박하고 있다는 지적이 나왔습니다. 공정 경쟁을 위해 자회사 규제의 실효성에 대한 논의가 필요합니다.'),(83,'2024-09-14 07:30:00.000000','2024-09-14 07:30:00.000000',1,'ce4db239-c1c0-4996-9947-f54eca46d886.mp3','23bc2027-20d9-4a55-81f0-12b352febbf5.mp3','2024년 9월 14일 꿀모닝 브리핑을 시작합니다.중동 지역의 갈등 상황이 더욱 심각해지고 있습니다. 최근 팔레스타인 무장정파 하마스의 이스라엘 테러 1주년을 맞아 카멀라 해리스 미국 부통령이 이날 워싱턴 DC에서 열린 추모행사에서 하마스의 테러를 \'악행 그 자체\'라며 이스라엘의 자위권을 재차 강조했습니다. 해리스 부통령은 \'10월 7일을 절대 잊지 않을 것\'이라고 밝히며, 이스라엘과 하마스 간의 휴전 논의를 재개할 것이라고 언급했습니다. 하지만 이러한 발언들이 바이든 행정부의 중동 문제 해결 능력에 대한 비판을 불러일으키는 가운데, 트럼프 전 대통령은 라디오 인터뷰에서 이란의 미사일 공격에 대한 이스라엘의 응전을 지지한다고 밝혔습니다. 이와 동시에 북한의 김정은 국무위원장이 한 달여 만에 포병학교를 찾아 실탄사격 훈련을 현지 지도하는 등 군사 준비 태세를 강화하고 있는 상황입니다. 북한에 대한 우려가 커지고 있으며, 전문가들은 김 위원장이 핵 보유를 선언한 것과 남북한 간의 적대적 관계를 보다 적극적으로 드러내고 있다고 보고하고 있습니다. 로버트 매닝 스팀슨센터 연구원은 북한의 군사력이 한국을 압도할 것이며, 미국의 개입을 억지할 것이라는 분석을 내놓았습니다. 매닝 연구원은 중현적 상황을 감안해 두 가지 전쟁 시나리오를 제시했으며, 동시에 대만과 한국을 겨냥한 중국과 북한의 동시 공격 가능성도 경고했습니다. 이처럼 중동과 한반도 모두 격렬한 긴장의 연속인 만큼, 향후 상황의 변화를 주의 깊게 살펴봐야 할 때입니다.','2024년 9월 14일 꿀모닝 브리핑을 시작합니다.중동 지역에서 이스라엘과 팔레스타인의 갈등이 또다시 타올랐습니다. 하마스의 테러 1주년을 맞아 미국의 카멀라 해리스 부통령은 이스라엘의 자위권을 재확인하며 하마스의 악행을 비난했습니다. 그는 이 사건을 결코 잊어서는 안 된다고 강조했고, 휴전 협상의 재개를 위한 미국의 의지를 내비쳤습니다. 한편, 트럼프 전 대통령은 이란에 대한 이스라엘의 공격을 지지한다고 언급했습니다. 북한의 김정은 국무위원장은 최근 군사 활동을 강화하며 한미 간의 긴장을 고조시키고 있는 상황입니다.'),(84,'2024-09-15 07:30:00.000000','2024-09-15 07:30:00.000000',1,'952c4bcb-d6a2-484b-81ac-7a2a4513d5a7.mp3','6ff32d5d-b259-4c30-9764-3d88accb459f.mp3','2024년 9월 15일 꿀모닝 브리핑을 시작합니다.어제 중동 지역에서 여러 가지 중요한 소식들이 전해졌습니다. 하마스가 이스라엘에 대한 공격을 감행한 지 1년이 되는 날, 카멀라 해리스 미국 부통령은 이스라엘의 자위권을 강력히 재확인하며 이스라엘과 하마스 간의 갈등을 언급했습니다. 해리스 부통령은 \'10월 7일\' 사태를 기억하라며 하마스의 테러 행위를 \'악행 그 자체\'로 규정하였고, 이를 기리기 위해 남편과 함께 석류나무를 심었습니다. 날이 갈수록 바이든 행정부의 중동 정책에 대한 비판이 커지고 있는데, 이는 미국의 입지가 약해지고 있다는 우려를 불러일으킵니다. 특히 트럼프 전 대통령은 이란을 응징해야 한다고 주장하며 이스라엘의 자위권을 지지했습니다. 아울러 포린폴리시 지에서 발표된 기고문에 따르면, 북한의 군사력과 핵무기 보유는 한국에 압박을 가하고 있다는 내용도 있습니다. 김정은 국무위원장은 다시 포병학교를 방문해 훈련을 지도하며 무력을 과시했습니다. 전문가들은 북한이 한국뿐 아니라 대만과도 동시에 전쟁을 벌일 가능성을 언급하며 국제적 긴장감이 고조되고 있다고 경고하고 있습니다. 이런 일련의 상황들은 중동 및 한반도에서의 불안정성을 더욱 심화시키고 있으며, 국제 사회의 대응이 절실해 보입니다.','2024년 9월 15일 꿀모닝 브리핑을 시작합니다.어제 중동과 관련된 여러 가지 중요한 뉴스가 있었습니다. 팔레스타인과 이스라엘 간의 갈등이 격화되면서, 하마스의 공격 1주년을 기념하는 자리에서 카멀라 해리스 부통령이 이스라엘의 자위권을 다시 강조했습니다. 해리스 부통령은 하마스의 행위를 악행으로 규정하고, 희생자들을 추모하기 위해 석류나무를 심는 의식을 가졌습니다. 또한, 북한의 김정은 국무위원장이 군사훈련을 진행하는 모습이 포착되었으며, 이는 남북한 긴장감과 국제적 불안을 더욱 고조시키고 있습니다. 미국은 중동 문제 해결에 어려움을 겪고 있다는 지적이 있으며, 이란과의 잠재적 충돌 가능성도 여전히 존재하는 상황입니다.'),(85,'2024-09-16 07:30:00.000000','2024-09-16 07:30:00.000000',1,'f01b0058-a276-4dd6-b502-45886550f5f9.mp3','7a94e772-c98c-4eee-b9b3-b0edf6aa64d7.mp3','2024년 9월 16일 꿀모닝 브리핑을 시작합니다.최근에 미슐랭 가이드가 2024 서울 & 부산 버전을 발표했어요. 특히 안성재 셰프가 운영하는 \'모수 서울\'이 유일하게 별을 받은 식당으로 주목받고 있는데, 안 셰프는 12세 때 미국으로 이민 가셨다가 2016년 한국으로 돌아와서 이 식당을 운영하고 있답니다. 현재 재오픈을 준비 중이며, 이 식당의 이름은 그가 어렸을 때 집 앞에 피어있던 코스모스에서 유래한 것이라고 하더라고요. 이 외에도 중식당 \'홍보각\'의 가격대가 일반인에게 상당히 부담스러운 가격으로 형성되어 있다는 사실도 함께 알려졌어요. 또한, 2030 세대 내에서 사주와 타로에 대한 관심이 상종가를 치고 있어요. 인터뷰를 통해 여러 사람들의 이야기를 들어보면, 사주와 타로를 통해 공감과 인생의 방향성을 찾으려는 모습이 인상적이었어요. 젊은 여성들 사이에서는 성평등을 고려한 사주 풀이도 인기를 끌고 있다고 하네요. 마지막으로, 심사평가원의 통계에 의하면 무릎 퇴행성관절염 환자가 점점 증가하고 있다고 해요. 2014년에는 1만8470명에서 2023년에는 2만2591명으로 늘어났다고 합니다. 특히 젊은 층에서 외부 충격이나 과도한 몸매 관리로 인해 관절염에 시달릴 수 있다고 하니, 평소에 적절한 체중 유지와 올바른 자세를 취하는 것이 중요하다고 전문가들이 강조하고 있어요. 운동할 때는 무릎 보호대를 착용하고, 무리가 가지 않도록 주의해야 해요.','2024년 9월 16일 꿀모닝 브리핑을 시작합니다.최근 미슐랭 가이드가 서울과 부산의 맛집을 발표했어요. 특히 안성재 셰프가 운영하는 \'모수 서울\'이 주목을 받는데요, 미슐랭 별을 보유한 이 식당은 재오픈을 준비하고 있습니다. 한편, 2030 세대에서 사주와 타로에 대한 관심이 높은 가운데, 이들 중 많은 이들이 삶의 방향성을 찾고자 하는 것 같아요. 통계에 따르면, 무릎 퇴행성관절염 환자가 증가하고 있는데, 특히 2040대에서 두드러지고 있습니다. 예방을 위해서 적절한 체중 유지와 올바른 자세가 중요하며, 운동 시 무릎 보호대 착용이 권장돼요.'),(86,'2024-09-17 07:30:00.000000','2024-09-17 07:30:00.000000',1,'e101beba-4431-4f99-aaf9-fa19c39fab5b.mp3','8489812b-334d-4b86-84d7-05ca5af6f2a7.mp3','2024년 9월 17일 꿀모닝 브리핑을 시작합니다.안녕하세요, 여러분. 오늘 전해드릴 뉴스는 세 가지 주요 사안입니다. 먼저, 경찰 당국이 마약에 대한 특별 단속을 시행하고 있는 가운데, 음식점 상호나 광고에서 여전히 \'마약\'이라는 용어가 빈번히 사용되고 있다는 문제가 제기되었습니다. 이런 용어 사용은 식품 관련 규정에 따라 제한되지만 강제성이 떨어져 현장에서는 여전히 마케팅에 활용되고 있어 규제의 보완이 요구되고 있습니다. 식약처는 국민들이 마약을 긍정적으로 인식하는 것을 예방하고 사회적 경각심을 높이기 위해 노력 중이라고 하지만, 온라인에서 대마 향을 표방하는 액상 전자담배의 유통이 지속되고 있어 논란이 되고 있습니다. 두 번째 뉴스로, 명태균 씨가 2022년 대선 기간 동안 윤석열 대통령 부부의 집을 방문해 정치적 조언을 했다고 밝히며 그 과정에서 여론조사 비용을 제공한 것으로 알려졌습니다. 이와 관련해 검찰은 \'돈 봉투\'가 수수되었다는 의혹을 두고 조사를 이어가고 있어 향후 상황에 따라 큰 파장이 예상됩니다. 마지막으로 문다혜 씨의 음주운전 사건이 큰 주목을 받고 있습니다. 문 씨는 최근 골목의 한 음식점에서 쫓겨난 후, 이태원에서 발생한 교통사고와 관련해 조사받고 있습니다. 사고 당시 문 씨는 비틀거리며 차량에 탑승하는 모습이 포착되었고, 이는 법적 절차와 관련해 많은 논란을 일으키고 있습니다. 이번 사건과 관련해 민주당과 문재인 전 대통령 측에서도 상황을 조심스럽게 지켜보고 있는 모습입니다. 오늘 전해드린 사항들을 유념하시기 바랍니다.','2024년 9월 17일 꿀모닝 브리핑을 시작합니다.안녕하세요, 여러분. 최근 뉴스입니다. 경찰이 마약에 대한 특별 단속을 강화하고 있지만, 여전히 음식점이나 광고에서 \'마약\'이라는 단어가 사용되는 사례가 존재해 규제 보완이 필요하다는 지적이 나오고 있습니다. 식약처는 이를 방지하기 위해 노력하고 있지만 온라인에서는 대마 관련 제품들이 여전히 판매되고 있어 논란이 되고 있습니다. 또한, 명태균 씨가 2022년 대선 당시 윤석열 대통령 부부에게 정치적 조언을 했다고 밝혔고, 이는 여론조사 비용과 관련된 논란으로 이어질 가능성이 큽니다. 마지막으로 문다혜 씨의 음주운전 사건이 큰 이슈로 떠올랐고, 법적 절차가 임박해 있어 관심이 집중되고 있습니다.'),(87,'2024-09-18 07:30:00.000000','2024-09-18 07:30:00.000000',1,'ac9c5e4c-ac9e-4fb8-aa9c-c3b3e5dacd29.mp3','ca6db2c9-effe-437d-88c2-fca954e0937f.mp3','2024년 9월 18일 꿀모닝 브리핑을 시작합니다.어제 조국 조국혁신당 대표는 문재인 전 대통령의 딸인 다혜 씨의 음주운전 사건과 관련하여, 문 전 대통령이 사과를 해야 한다는 요구가 지나치다는 입장을 밝혔습니다. 조 대표는 8일 CBS라디오 방송에 출연해, 문 전 대통령이 과거에 음주 운전은 살인 행위라고 언급한 만큼 도의적 책임을 묻는 목소리에 대해 과하다는 생각을 드러냈습니다. 그는 다혜 씨가 성인으로서 스스로 책임을 져야 하고 이를 따라서 문제를 해결해야 한다고 강조했습니다. 문다혜 씨는 이태원 인근에서 음주 상태로 차량을 운전하던 중 사고를 일으킨 바 있습니다. 또한, 윤석열 대통령은 현재 김건희 여사에 대한 리스크에 대한 대응 수위를 점차높이고 있는 상황입니다. 한동훈 국민의힘 대표는 여론에 대한 민감한 반응을 강조하며, 더불어민주당의 \'김여사\' 이슈에 대해서도 진정성 있는 대처가 필요하다고 말했습니다. 그 외에도 한 대표는 당 협력 및 정치적 대응 전략에 대해 깊이 고민하고 있다고 전해지며, 당내에서의 분열과 갈등 문제에도 주의를 기울이고 있는 것으로 보입니다. 현재 국민의힘 내부에서는 한 대표의 행보에 대해 염려하는 목소리가 나오고 있으며, 당의 단결을 강조하는 의원들의 의견이 있었습니다.','2024년 9월 18일 꿀모닝 브리핑을 시작합니다.어제 조국 조국혁신당 대표는 문재인 전 대통령의 음주운전 문제에 대한 사과 요구가 과하다는 의견을 밝혔습니다. 그는 다혜 씨가 성인이므로 스스로 책임을 져야 한다고 강조했습니다. 한편, 윤석열 대통령은 김건희 여사에 대한 리스크에 대해 대응 수위를 높이고 있으며, 여당 내에서 요구되는 조치에 대해 고민하고 있습니다. 국민의힘 한동훈 대표는 이런 상황을 반영하여 여론에 민감하게 반응할 필요성을 언급했습니다.'),(88,'2024-09-19 07:30:00.000000','2024-09-19 07:30:00.000000',1,'7a30af60-b5a7-4ac2-8bde-f9479efd88a9.mp3','57974402-b7ca-454f-ab43-29a5c3bdbc2c.mp3','2024년 9월 19일 꿀모닝 브리핑을 시작합니다.안녕하세요, 오늘의 뉴스 브리핑입니다. 경찰 당국이 마약과 관련된 특별 단속을 실시하고 있는 가운데, 음식점과 광고에서 \'마약\'이라는 단어 사용 사례가 여전히 존재하고 있습니다. 식약처는 마약이라는 용어를 긍정적이고 친화적으로 인식하게 되는 것을 막기 위해 노력하고 있지만, 이러한 시도가 원활하게 진행되고 있지 않다고 지적되고 있습니다. 특히 온라인 쇼핑몰에서는 대마를 소재로 한 제품들이 불법적으로 광고되고 있는 등 실질적인 규제의 필요성이 대두되고 있습니다. 다음 소식으로, 명태균씨가 윤석열 대통령 부부의 집을 방문해 대선 당시 여론조사 비용을 제공한 사실이 밝혀졌습니다. 그는 2022년 대선 기간 중 대통령 측에 매일 여론조사 결과를 보고했다고 전했습니다. 이와 관련하여 검찰이 \'돈 봉투\' 수수 문제에 대한 조사를 강화하고 있어 정치적으로 큰 파장을 일으키고 있습니다. 마지막으로 문다혜씨의 음주운전 사건이 논란이 되고 있습니다. 서울 용산구에서 발생한 이 사건은 문씨가 운전 중 음주 상태로 사고를 일으켰다는 점에서 법적 절차가 진행되고 있음을 알리고 있습니다. 민주당도 이번 사건에 대한 입장을 내세우고 있으며, 관련 정치적 세력들도 사건에 대한 언급을 피하고 있는 상황입니다. 이러한 일련의 사건들은 현재 사회적 관심을 받고 있으며 경찰과 검찰의 후속 조치가 주목됩니다.','2024년 9월 19일 꿀모닝 브리핑을 시작합니다.오늘의 주요 뉴스입니다. 경찰은 마약 관련 특별 단속을 강화하고 있지만, 여전히 음식점과 광고에서 \'마약\'이라는 표현이 사용되고 있어 규제 보완 필요성이 제기되고 있습니다. 또한, 명태균씨가 2022년 대선 당시 윤석열 대통령에게 여론조사 비용을 제공한 사실이 드러났습니다. 마지막으로, 문다혜씨의 음주운전 사건이 논란이 되고 있으며 법적 절차가 진행 중입니다.'),(89,'2024-09-20 07:30:00.000000','2024-09-20 07:30:00.000000',1,'b24ac70c-71bd-435f-821e-4db037c762cf.mp3','ccae58df-dba6-408a-91f1-4361c9253141.mp3','2024년 9월 20일 꿀모닝 브리핑을 시작합니다.오늘 하루 내륙에서는 구름만 지나갈 예정이지만, 동쪽 지역은 밤까지 산발적인 비가 예상되고 있어요. 특히 내일 한글날에는 뚜렷한 비 소식 없이 온화한 가을 날씨가 이어질 것으로 보인답니다. 현재 서울의 기온은 23도를 넘어 온화함이 감돌고 있으며, 야외 활동에는 매우 좋은 날씨가 될 것 같습니다. 그러나 제주도는 흐린 날씨 속에 5~20mm의 비가 가끔 내릴 것으로 보여 유의해야 해요. 동해안 지역에도 약한 비가 내릴 것으로 예상되며, 밤에는 대부분 그칠 예정이지만 영동 지방의 비는 내일 새벽까지 이어질 것 같아요. 저녁이 되면 기온이 10도 정도 떨어져 쌀쌀할 수 있으니, 마스크나 따뜻한 옷을 준비하는 게 좋겠어요. 한편, 북한의 탈북자 문제와 관련하여 진행된 토크쇼에서는 탈북민 강제북송 문제가 시급하게 다뤄졌습니다. 이날 패널들은 현재 중국에서 북송되는 탈북민을 막는 것이 더 중요하다고 입을 모았어요. 그들은 ‘MZ 탈북민’ 세대의 경험이 우리에게 주는 교훈에 대해서도 이야기를 나누며 앞으로의 해결책을 모색했습니다. 마지막으로 배우 유승호는 25년 만에 연극 무대에 서는 소감을 밝혔습니다. 유승호는 연극 \'엔젤스 인 아메리카\'에 출연하며, 파격적인 장면들을 소화해 관객들에게 강한 인상을 남겼습니다. 그는 이 작품을 통해 사랑의 메시지가 담겨 있다고 느끼며, 연극의 매력을 깊이 체험한듯하네요. 새로운 작품과의 만남을 기대하고 있다고 하니 유승호의 연기 활동에 앞으로도 많은 관심 부탁드려요.','2024년 9월 20일 꿀모닝 브리핑을 시작합니다.오늘 내륙은 구름만 지나고 있지만, 동쪽 지역에서는 밤까지 산발적인 비가 예상됩니다. 내일 한글날에는 온화한 가을 날씨가 이어질 것으로 보이며, 서울 기온은 23도를 웃돌아 야외 활동하기 좋은 날씨가 될 거에요. 제주도에서는 비가 오락가락할 것으로 보이고, 동해안 지역에도 약한 비가 내리겠지만 밤에는 대부분 그칠 예정입니다. 저녁에는 기온이 떨어져 쌀쌀할 수 있으니 외출 시 주의가 필요해요. 또한, 북한의 탈북자 문제와 관련된 토크쇼가 진행되었는데, 탈북민 강제북송 문제에 대한 시급함이 강조되었습니다. 유승호 배우는 데뷔 25년 만에 연극 무대에 서게 되어 감동적인 소감을 전했는데, 그의 연기 도전이 많은 화제를 모으고 있습니다.'),(90,'2024-09-21 07:30:00.000000','2024-09-21 07:30:00.000000',1,'d8bfdf2d-ae3b-4ffa-acd4-f9ed06e14bba.mp3','b553df44-2d1c-4131-ab23-9dfff129761a.mp3','2024년 9월 21일 꿀모닝 브리핑을 시작합니다.최근 춘천지법에서 스토킹 사건의 1심 판결이 내려졌습니다. 50대 남성이 23살 연하의 여성과 사귀던 중 혼인 여부와 나이를 속인 사실을 알고 결별하게 된 이 여성에게 약 2개월에 걸쳐 25차례의 문자 메시지를 보내며 집착하다가 스토킹 혐의로 기소되어 500만원의 벌금을 부과받았어요. 이후 40시간의 스토킹 예방 프로그램 이수도 명령받았다고 하네요. 또한 여의도에서 열린 불꽃축제 기간 중 한 아파트 주민이 외부인으로부터 와인을 마시는 모습을 촬영한 사진을 올려 논란이 되었습니다. 해당 주민은 자신이 입주민으로 초대받아 간 것이라고 해명하며, 축제 관람 중에도 조용히 관람하려고 했다고 밝혔습니다. 이와 관련해 누리꾼들은 다양한 반응을 보이고 있어요. 다음으로 신재호 원장이 ADHD 치료의 필요성과 개인 경험을 공유하며, ADHD가 유전적인 요인에 의한 것임을 강조했습니다. 그는 뇌 기능의 저하를 겪고 있는 고기능 ADHD 환자들이 상당수 있으며, 이들에게도 적절한 치료가 필요하다고 말했어요. 한편, 한국의 애슬레저 시장이 아시아에서 큰 인기를 얻고 있는데, 젝시믹스와 안다르 같은 브랜드들이 높은 성장세를 보이고 있으며, 특히 일본에서는 독창적인 기능성 제품이 소비자들에게 각광받고 있다고 합니다. 마지막으로, 미국 남동부로 접근 중인 허리케인 \'밀턴\' 소식이 있는데요, 민주당 대선후보인 카멀라 해리스 부통령과 조 바이든 대통령은 허리케인에 대비한 지원 사격으로 순방 일정을 연기했습니다. 이 외에도 이스라엘군이 레바논 남부를 공격하고 있으며, 헤즈볼라 수장이 사망했다는 소식도 들어왔습니다. 이렇게 다양한 사건들이 발생하고 있으니 앞으로의 전개도 주목해봐야겠어요.','2024년 9월 21일 꿀모닝 브리핑을 시작합니다.최근 스토킹 사건이 법원의 판결을 받았는데, 50대 남성이 결별한 여성에게 2개월간 25차례에 걸쳐 연락을 지속한 혐의로 500만원의 벌금을 받았어요. 또, 여의도 불꽃축제 때 아파트에서 와인을 마신 한 주민이 외부인으로 오해를 사면서 논란이 되었고, 이에 대한 해명글이 올라왔습니다. 또한, ADHD 치료의 필요성이 크다는 연구 결과와 더불어, 건강과 패션을 결합한 애슬레저 제품이 아시아 시장에서 인기라고 하네요. 마지막으로, 미국에서 대형 허리케인 \'밀턴\'이 접근하고 있다는 소식과 함께 이스라엘군이 레바논에서의 공세를 지속하고 있다는 소식도 전해드려요.'),(91,'2024-09-22 07:30:00.000000','2024-09-22 07:30:00.000000',1,'05694819-8374-472d-94a6-fe0096f838a1.mp3','efd2a5d5-39a7-4d91-af5b-32029f55d565.mp3','2024년 9월 22일 꿀모닝 브리핑을 시작합니다.안녕하세요, 어제의 주요 뉴스를 종합해서 전해드릴게요. 올해 국정감사에서는 자회사 스노우에서 제공하는 AI 합성 서비스가 논란이 됐습니다. 스노우의 서비스에서 선정적인 이미지가 출력되는 문제가 제기됐으며, 이용자 콘텐츠를 AI에 학습시키기 위해 필수 동의하도록 하는 불공정 약관도 지적되었습니다. 특히 딥페이크 성범죄 문제가 대두된 상황이라 이러한 서비스의 오류가 더욱 주목받았습니다. 여기에 대해 스노우는 해당 서비스가 오픈소스 AI인 ‘스테이블 디퓨전’을 따르기 때문에 회사의 책임이 아니라는 입장을 밝혔고, 네이버는 약관 관련 질문에 ','2024년 9월 22일 꿀모닝 브리핑을 시작합니다.안녕하세요, 어제의 주요 뉴스를 전해 드리겠습니다. 올해 국정감사에서는 자회사 스노우의 AI 합성 서비스에서 발생한 외설 이미지 문제와 이용자 콘텐츠 학습에 대한 불공정 약관이 지적되었습니다. 특히 딥페이크 성범죄 문제로 인해 큰 관심을 받게 되었고, 네이버는 이러한 서비스가 오픈소스 기반이라고 주장하며 책임을 회피하려 했습니다. 다음으로, AI 분야의 권위자인 홉프리 힌턴 교수는 AI가 인간을 뛰어넘을 것이라는 우려를 표명하며 역사적 분기점에 있다고 강조했습니다. 마지막으로, 박남규 성균관대 교수는 ‘2024 대한민국최고과학기술인상’을 수상하면서 노벨상 수상 가능성에 대한 기대를 모으고 있습니다. 그는 태양전지 기술 연구에 매진하며 환경 문제 해결을 위한 노력을 기울이고 있습니다.'),(92,'2024-09-23 07:30:00.000000','2024-09-23 07:30:00.000000',1,'ae4d5d33-628a-4e21-abf3-6fdb0ea388ab.mp3','b5623c4f-b5ca-4433-b1f5-f1a3fb4bdd49.mp3','2024년 9월 23일 꿀모닝 브리핑을 시작합니다.11월 5일 대선을 대비해 미국 남동부로 접근 중인 대형 허리케인 \'밀턴\'에 대해 카멀라 해리스 부통령과 조 바이든 대통령이 순방 일정을 무기한 연기하기로 결정하며 위기에 대응하고 있습니다. 해리스 부통령은 허리케인 밀턴의 예상 경로에 거주하는 주민들에게 공무원의 대피 요구에 반드시 따를 것을 당부했습니다. 이 허리케인의 위력은 2005년 카트리나 허리케인과 비교될 정도로 강력하며, 플로리다와 조지아, 노스캐롤라이나 지역의 대선 투표에 차질이 생길 수도 있다는 우려가 제기되고 있습니다. 또한, 이스라엘군은 지난달 30일 레바논 남부를 침공한 이후 군력을 증강하며 헤즈볼라에 대한 공세를 강화하고 있습니다. 지난 27일 베이루트 외곽에서 이스라엘의 공습으로 헤즈볼라 수장 하산 나스랄라가 사망했으며, 이번에는 그의 후계자로 지목되었던 하심 사피에딘까지 제거된 것으로 확인되었습니다. 이런 상황에서 헤즈볼라 측은 항전을 다짐하면서도 레바논 의회의장의 휴전 노력을 지지하겠다고 발언해 휴전 협상 가능성을 남겼습니다. 미국과 아랍 국가들은 중동 전선의 전반적인 휴전을 위해 이란과 비밀 회담을 시작했다는 보도도 나오면서, 긴장이 고조되고 있습니다. 마지막으로, 도널드 트럼프 전 대통령이 재임 중 블라디미르 푸틴 러시아 대통령에게 코로나19 진단 장비를 개인적으로 보냈다는 주장이 제기됐습니다. CNN의 보도에 따르면, 미 언론인 밥 우드워드의 신간 \'전쟁(War)\'에서 언급된 내용으로, 트럼프와 푸틴은 여러 차례 통화를 나눈 것으로 나타났습니다. 그레이엄 의원은 트럼프가 변덕스러워지고 있다고 비판했으며, 트럼프 전 대통령은 이 책과 관련된 인터뷰 없이 이를 강하게 반발하고 있습니다.','2024년 9월 23일 꿀모닝 브리핑을 시작합니다.11월 5일 대선을 앞두고 대형 허리케인 \'밀턴\'이 미국 남동부로 이동하면서 카멀라 해리스 부통령과 조 바이든 대통령은 순방 일정을 연기하고 대피를 권고했습니다. 해리스 부통령은 주민들에게 공무원의 대피요구에 따라줄 것을 요청하며, 허리케인으로 인해 플로리다와 조지아, 노스캐롤라이나 지역의 대선 투표에 차질이 우려된다고 밝혔습니다. 한편, 이스라엘군은 레바논을 침공하며 헤즈볼라 수장과 후계자를 제거하는 공세를 이어가고 있습니다. 헤즈볼라의 반응으로는 항전을 다짐하면서도 휴전에 대한 언급이 있었습니다. 마지막으로, 도널드 트럼프 전 대통령이 재임 중 블라디미르 푸틴에게 코로나19 진단 장비를 보냈다는 주장이 제기되었고, 이와 관련된 논란이 이어지고 있습니다.'),(93,'2024-09-24 07:30:00.000000','2024-09-24 07:30:00.000000',1,'2f358370-2dbd-4835-8f08-1a7c24ad3209.mp3','9acb33ca-0999-4749-a811-e3bbd010d2ce.mp3','2024년 9월 24일 꿀모닝 브리핑을 시작합니다.신재호 원장이 운영하는 신재 정신건강의학과의원에서는 ADHD가 상당 부분 유전적 요인의 영향을 받고 있다는 사실을 강조하고 있습니다. 신 원장에 따르면 고기능 ADHD 환자들은 다소 자기 반응이 과중해져 정서적 번아웃을 경험할 수 있으며, 치료가 필요한 경우도 잇따라 발생한다고 전해졌습니다. 또한, 최근 틱톡에서 화제를 모은 \'체중감량 커피 제조법\'에 대한 영상이 인기를 끌고 있습니다. 여기에서는 계핏가루가 다이어트에 도움이 될 수 있다고 언급하며, 인슐린 저항성을 개선하고 열을 만들어 몸을 따뜻하게 해준다는 이점이 소개되었습니다. 연구에서는 계피가 체중 감소와 혈액 순환에 긍정적인 영향을 미친다고 하니 참고해 보시면 좋겠네요. 마지막으로, 애슬레저 아이템에 대한 수요가 급증하고 있으며, 특히 K브랜드인 젝시믹스와 안다르가 해외 시장에서 두각을 나타내고 있습니다. 이들은 중국과 일본에서의 인기를 바탕으로 해외 확장을 계획하고 있으며, 독특한 소재와 기능성 제품으로 많은 관심을 받고 있습니다. 젝시믹스는 걸그룹 (여자)아이들 멤버를 활용한 스타 마케팅으로 인지도를 높이고 있다고 하며, 다양한 색상과 뛰어난 소재의 기능성 의류들이 해외 소비자들에게 사랑받고 있다는 소식입니다.','2024년 9월 24일 꿀모닝 브리핑을 시작합니다.신재호 원장이 운영하는 신재 정신건강의학과의원에서는 ADHD에 대한 중요성을 강조하고 있으며, 고기능 ADHD 진단과 치료가 필요한 경우가 많다고 합니다. 또한, 최근 틱톡에서 소개된 \'체중감량 커피\' 제조법이 주목받고 있는데, 계핏가루가 다이어트에 효과적이라는 연구 결과도 있습니다. 마지막으로, 애슬레저 패션이 중국과 일본에서 인기를 끌고 있으며, K브랜드인 젝시믹스와 안다르가 해외 시장에서 좋은 성과를 내고 있다고 하네요.'),(94,'2024-09-25 07:30:00.000000','2024-09-25 07:30:00.000000',1,'327ac22f-b03f-47c3-83ab-952ee48425f7.mp3','fb4fdab4-cc43-4bfa-b8d7-ec3d63e4d74b.mp3','2024년 9월 25일 꿀모닝 브리핑을 시작합니다.9일자로 한국이 세계국채지수인 WG에 편입되면서 본격적으로 선진 금융시장으로 평가받고 있습니다. 이번 편입으로 채권시장에는 약 80조원의 자금 유입이 예상되며, 특히 이는 국채 발행 여력을 증가시키고 조달 비용을 줄이는 긍정적인 효과를 가져올 것으로 보입니다. WG는 미국, 영국, 독일, 일본 등 주요 선진국들과 함께 한국을 포함한 \'선진 국채클럽\'으로 여겨지며, 한국 국채에 대한 글로벌 투자자들의 신뢰도가 더욱 높아졌다는 것을 의미합니다. 정부는 그간 시장 접근성을 제고하기 위해 국채통합계좌 개설과 원/달러 거래 마감시간 연장 등 다양한 제도를 시행해왔습니다. 이번 지수 편입은 이러한 지속적인 노력의 산물로 평가받고 있으며, 글로벌 투자자들에게 긍정적인 신뢰를 얻었다는 분석이 나오고 있습니다. 그러나 삼성전자는 최근 3분기 잠정 영업이익이 9조 1000억원으로 집계되며, 시장의 예상을 크게 하회하는 \'어닝쇼크\'를 겪었습니다. 지난해 1분기 저점 이후 반등했던 삼성전자의 영업이익은 다시 하락세로 돌아섰고, 이는 주력 제품인 범용 D램의 수요 부진이 주원인으로 작용하고 있습니다. 삼성의 경영진은 이를 극복하기 위해 기술과 품질을 최우선으로 삼으며 근본적인 경쟁력 강화를 다짐하고 있습니다.','2024년 9월 25일 꿀모닝 브리핑을 시작합니다.9일 한국이 세계국채지수(WG)에 편입되면서 선진 금융시장으로 인정받게 되었습니다. 이로 인해 80조원의 자금이 채권시장에 유입될 것으로 보이며, 국채 발행 여력이 늘어나고 조달 비용이 감소할 것으로 예상됩니다. 정부는 시장 접근성을 높이기 위해 다양한 제도를 개선해왔고, 이번 편입은 이러한 노력이 결실을 맺은 결과입니다. 반면, 삼성전자는 3분기 잠정 영업이익이 시장 전망치를 하회하는 \'어닝쇼크\'를 기록했습니다. 주력 제품인 D램 수요가 부진한 가운데, 삼성전자는 기술과 품질을 우선시하며 근본적인 경쟁력 확보를 다짐했습니다.'),(95,'2024-09-26 07:30:00.000000','2024-09-26 07:30:00.000000',1,'732eebdf-af66-46de-a08c-c9658f3861ba.mp3','ccfe9ead-6069-4663-a073-40a8364f2fba.mp3','2024년 9월 26일 꿀모닝 브리핑을 시작합니다.안녕하세요. 어제 있었던 주요 뉴스들을 종합해서 전해드릴게요. 8일 서울의 한 대형병원에서 응급의료센터에서 진행된 의료개혁에 관한 공개 토론회가 10일 예정되어 있어 많은 기대를 모으고 있습니다. 의정 갈등 상황에서 양측의 대화는 드물기 때문에 이날 토론의 결과가 주목됩니다. 아울러, 한국중증질환연합회는 최근 정부가 도입한 의대 5년제 정책에 대해 갈등을 초래하고 있다며 중단을 촉구했습니다. 이들은 의료 개혁의 필요성에는 동의하지만, 지금처럼 의료 시스템이 불안정한 상황에서 이러한 정책이 혼란을 가중시킬 것이라 우려하고 있습니다. 또, 한국어교원협회가 실시한 설문조사 결과, 한국어교원 절반 이상이 월 200만 원 미만의 급여를 받고 있으며, 제도적 보호가 부족하다는 사실을 알리며 근로 조건 개선이 시급하다는 목소리를 높였습니다. 반면, 허리케인 밀턴이 플로리다주에 상륙할 예정으로, 대피 행렬이 이어지고 있으며, 이전에 겪었던 허리케인 헐린으로 인한 재난 피해도 고려되면서 이 대선의 변수로 작용할 수 있습니다. 마지막으로, 남중국해에서 중국 해경선이 필리핀 선박에 물대포 공격을 가하며 긴장이 높아지고 있습니다. 이는 필리핀 정부가 이러한 상황을 예의주시하고 있으며, 양국 간의 외교적 긴장이 심화될 가능성도 있어 주의가 필요합니다.','2024년 9월 26일 꿀모닝 브리핑을 시작합니다.안녕하세요. 어제 있었던 주요 뉴스들을 전해드릴게요. 서울의 한 대형병원에서 응급 medical issues와 관련한 의료개혁 토론회가 열리는데, 의정 양측의 공개 대화가 드문 만큼 기대가 큽니다. 특히, 한국중증질환연합회는 의대 5년제 정책 중단을 촉구하며 의료계와 정부 간 갈등이 심화될 것을 우려했습니다. 이와 관련해 한국어교원들의 노동 실태도 문제점으로 지적되며, 월 200만 원 미만의 급여 수령자가 많아 노동 조건 개선이 필요하다는 목소리가 높아지고 있습니다. 허리케인 밀턴이 미국 플로리다주를 강타할 예정이며, 대피 행렬이 이어지는 가운데 이전에 발생한 허리케인 헐린의 피해를 감안할 때 정치적 변수로 작용할지 주목됩니다. 남중국해에서는 중국 해경선이 필리핀 선박에 대한 물대포 공격 사건이 발생해, 해당 지역의 긴장감이 고조되고 있습니다.'),(96,'2024-09-27 07:30:00.000000','2024-09-27 07:30:00.000000',1,'aea20dc1-aea2-4fdb-8e2f-1ad71a2f655b.mp3','96f077f6-f4d5-46ee-a5c4-b5c495127850.mp3','2024년 9월 27일 꿀모닝 브리핑을 시작합니다.MBK파트너스가 고려아연 및 영풍정밀에 대한 공개매수 가격을 더 이상 올리지 않겠다는 입장을 밝혔습니다. 이번 결정은 공개매수가 회사의 적정 가치에 비해 충분히 높은 가격으로 제시되고 있다는 점에서 출발했으며, 추가적인 가격 경쟁이 두 기업의 가치를 훼손할 수 있다는 우려를 내포하고 있습니다. 고려아연은 MBK의 공개매수에 대해 신중하게 대응하고 있으며, 공개매수 상황이 본인들에게 불리하게 작용할 수 있다며 MBK의 공개매수에 응하라는 메시지를 발신했습니다. 재계에서는 이러한 경쟁이 승자의 저주를 초래할 가능성이 크다는 분석이 나오고 있습니다. 연이어 영국 FTSE러셀이 한국을 채권시장 국가분류에 편입할 예정임을 발표했습니다. 이 계획에 따르면 내년 11월부터 한국 국채의 편입 비중은 2.2%로 정해졌으며, 약 560억 달러 규모의 자금이 한국 시장으로 유입될 것으로 기대됩니다. 이는 한국 국채에 대한 투자 신뢰도가 더욱 강화되고 있음을 보여주며, 관련하여 금융시장은 더욱 안정화 될 전망입니다. 김한수 자본시장연구원 연구위원은 이러한 변화가 기업의 자금조달 비용을 감소시킬 것으로 예상하고 있습니다. FTSE러셀은 한국 증시에 대한 선진시장 지위를 부여하며 시장 안정성을 높이고 정부의 재정 건전성을 유지하는 것을 목표로 하고 있습니다. 한국 정부 또한 지난 해 공매도를 주가 하락의 주범으로 규정한 뒤 금지해왔으나, 앞으로 공매도 전체 재개를 목표로 하고 있다는 의견이 제기되며 시장의 규칙과 안정성을 계속해서 유지하려고 하고 있습니다.','2024년 9월 27일 꿀모닝 브리핑을 시작합니다.MBK파트너스는 고려아연과 영풍정밀의 공개매수 가격을 더 이상 인상하지 않겠다고 밝혔습니다. 이는 추가적인 가격 경쟁이 기업 가치에 해로울 수 있다는 판단에서 비롯된 것입니다. 고려아연은 이에 대한 반대의견을 제시하며 MBK의 공개매수에 응하라는 메시지를 전달했습니다. 한편 FTSE러셀은 한국을 채권시장 국가분류에 편입할 계획을 발표했으며, 이로 인해 약 560억 달러 규모의 자금 유입이 기대되고 있습니다. 한국 국채에 대한 신뢰도가 높아지고 있으며, 이는 한국 금융시장 안정화에 기여할 것으로 예상됩니다.'),(97,'2024-09-28 07:30:00.000000','2024-09-28 07:30:00.000000',1,'33803c8b-f975-4df7-b86e-f56eaa0a6628.mp3','5c36dc0b-96f3-4d15-a849-4771724bd342.mp3','2024년 9월 28일 꿀모닝 브리핑을 시작합니다.어제 MBK파트너스가 고려아연과 영풍정밀에 대한 공개매수 가격을 추가로 올리지 않겠다고 공식 발표했어요. 이 결정은 최윤범 고려아연 회장 측의 가격 인상 가능성이 거론되자 이를 방어하기 위한 조치로 해석되고 있어요. MBK는 이 과정에서 두 회사의 기업가치를 지키겠다는 의지를 강조하며, 임직원 고용 보장 및 기술 유출 우려를 불식시키겠다고 덧붙였어요. 이어서 고려아연 측은 MBK의 공개매수에 대응하기 위해 자사주 공개매수를 진행 중이며, 상황이 복잡하게 얽히고 있답니다. 지난 9일에 이어 연일 이어지는 양측의 대응은 긴장감을 더욱 높이고 있습니다. 한편, 영국의 FTSE러셀이 오는 11월부터 한국을 채권시장 WG에 편입할 계획이라고 발표했어요. 이로 인해 약 560억 달러 규모의 자금이 한국 국채에 유입될 것으로 예상되는데, 이는 한국 금융시장의 안정화와 기업의 자금조달 비용 감소로 이어질 것으로 기대됩니다. FTSE러셀은 한국의 재정건전성과 자본시장 선진화에 대한 신뢰를 확인하며 이번 결정을 내린 것으로 보입니다. 또한, 한국 정부는 공매도 재개에 대한 가능성을 시사했으며, 이는 FTSE러셀이 한국 증시를 관찰대상국으로 지정하지 않게 된 요인 중 하나로 분석되고 있어요. 앞으로 한국 증시의 선진국 지수 편입 과제를 해결하기 위한 노력이 더욱 필요할 것으로 전망됩니다.','2024년 9월 28일 꿀모닝 브리핑을 시작합니다.어제 MBK파트너스가 고려아연과 영풍정밀에 대한 공개매수 가격을 더 이상 올리지 않겠다고 밝혔어요. 최윤범 고려아연 회장 측이 가격 인상을 시사하자 이를 저지하기 위한 조치로 보입니다. 또한, 영국 FTSE러셀이 한국을 오는 11월부터 채권시장 WG에 편입할 계획이라고 발표하며, 약 560억 달러의 국채자금이 유입될 것으로 예상하고 있습니다. 이는 한국 금융시장 안정화와 기업 자금조달 비용 감소로 이어질 것으로 전망됩니다.'),(98,'2024-09-29 07:30:00.000000','2024-09-29 07:30:00.000000',1,'ce6e8478-5809-4572-9b00-bbca98e316ec.mp3','30210d6e-a153-4f3a-aec7-980a3c3dba7b.mp3','2024년 9월 29일 꿀모닝 브리핑을 시작합니다.안녕하세요, 오늘 뉴스 브리핑입니다. 최근 정치계에서는 국민의힘 한동훈 대표가 부산 금정구에서 열린 현장최고위원회에서 김건희 여사의 공천 개입 의혹에 대해 기자들과 만나 반박하는 모습을 보였습니다. 그는 명태균 씨를 \'정치 거간꾼\'이라며 야권의 비난이 부당하다고 주장했습니다. 한동훈 대표는 더불어 이진숙 방통위원장 후보자와 관련된 국회 전체회의에서의 진행 상황도 언급하며 정치적 상황의 중요성을 강조했습니다. 한편, 북한은 공식적으로 남북 간의 물리적 단절 조치를 발표했습니다. 조선인민군 총참모부는 대한민국 영토와의 철저한 분리를 위해 실질적인 군사적 조치를 취하겠다고 밝혔습니다. 김정은 위원장이 지난해 12월 남북을 \'적대적 두 국가\'로 선언한 이후 이러한 조치는 계속되어 왔으며, 이번 공식 발표는 긴장이 고조되고 있는 시점에서 이루어졌습니다. 이에 대해 우리 군은 북한의 결정을 더욱 고립적인 상황으로 만들 것이라고 지적하며 철저한 대응에 나설 것이라고 경고했습니다. 마지막으로 민주당은 금정구청장 후보인 김경지를 지지하며 이번 재보궐 선거가 지역 현안 해결과 더불어 정권 심판의 기회로 삼아야 한다고 강조했습니다. 이러한 의지를 보이며 민주당은 이번 선거의 중요성을 재차 상기시켰습니다. 감사합니다.','2024년 9월 29일 꿀모닝 브리핑을 시작합니다.안녕하세요, 오늘 뉴스 브리핑입니다. 최근 정치계에서는 국민의힘 한동훈 대표가 부산 금정구에서 열린 현장최고위원회에서 발언하며 김건희 여사의 공천 개입 의혹에 대해 반박했습니다. 그는 명태균 씨를 정치 거간꾼으로 간주하며 야권의 비난이 부당하다고 주장했습니다. 한편, 북한은 남북 간 물리적 단절을 공식화하며 실질적인 군사적 조치를 취하겠다고 발표했습니다. 김정은 위원장은 지난해 남북 관계를 적대적으로 선언한 뒤 해당 조치를 진행해 왔습니다. 이러한 북한의 결정에 대해 우리 군은 더욱 강력한 고립을 초래할 것이라 경고하며, 북한의 행동을 주시할 것이라고 밝혔습니다. 민주당은 금정구청장 후보에 대한 지지를 호소하며 이번 재보궐 선거의 중요성을 강조했습니다. 지역 현안을 해결하겠다는 의지를 보이며 오는 선거가 정권 심판으로 이어져야 한다고 주장했습니다. 감사합니다.'),(99,'2024-09-30 07:30:00.000000','2024-09-30 07:30:00.000000',1,'e731f865-35ee-4bde-839e-30ef23f28dc0.mp3','4e9f5286-2e1f-4ef9-93a8-7b8e4954b0d1.mp3','2024년 9월 30일 꿀모닝 브리핑을 시작합니다.서울의 한 대형병원 응급실에서의 진료 지연 문제로 의정 갈등이 심화되고 있는 상황에서, 10일 오후 2시부터 4시까지 보건복지부와 서울대 의대 교수협의회가 주최하는 \'의료개혁, 어디로 가는가\'란 주제의 토론회가 열리게 됩니다. 이번 토론회는 의사와 정부가 공개적으로 논의하는 드문 기회로, 의정 양측은 지속 가능한 의료체계 구축 방안에 대한 질문을 던질 계획입니다. 그러나 현재 대한전공의협의회 등 주요 의사단체들은 여전히 정부와 대화하는 데 부정적인 입장을 보이고 있어 우려를 낳고 있습니다. 이와 같은 의정 갈등의 여파로 한국중증질환연합회는 의대 5년제 정책이 의료계 내 갈등을 부추기고 있다는 입장을 보이며, 정부에 대한 신뢰가 저하되고 있다고 비판했습니다. 이들은 현 사태를 해결할 의지가 있는지 의문을 제기하며, 정책의 책임자를 문책하고 진정성 있는 논의를 촉구했습니다. 또한, 한국어교원협회가 실시한 조사에 따르면, 많은 한국어교원들이 저임금과 열악한 노동 조건에 시달리고 있는 것으로 드러났고, 그로 인해 직업에 대한 추천 조차 꺼려하고 있다고 밝혔습니다. 이러한 상황 속에서 한국어교원들은 한국어 가르치는 일이 멋진 일이 되도록 노동 조건 개선을 위해 힘써야 한다고 주장하고 있으며, 이와 관련된 논의가 최근 국회에서 진행되었습니다.','2024년 9월 30일 꿀모닝 브리핑을 시작합니다.서울 대형병원 응급실에서 발생한 진료 지연 문제에 대한 의정 갈등이 이어지고 있는 가운데, 보건복지부와 서울대 의대 교수협의회가 의료개혁을 주제로 열린 토론회가 10일 오후 개최될 예정입니다. 이 자리에서는 지속 가능한 의료체계 구축 방안에 대한 논의가 이루어질 예정인데, 현재 의사협회와 정부 간의 대화가 원활하지 않아 우려의 목소리가 커지고 있습니다. 또한, 한국중증질환연합회는 의대 5년제 정책을 중단할 것을 촉구하며 이로 인해 환자와 의료계의 갈등이 더욱 심화되고 있다고 전했습니다. 마지막으로, 한국어교원들의 실태 조사에서 많은 교원들이 저임금으로 어려움을 겪고 있으며, 이 같은 문제를 해결하기 위한 논의가 최근 국회에서 진행되었습니다.'),(100,'2024-10-01 07:30:00.000000','2024-10-01 07:30:00.000000',1,'82ac6e09-9aa1-441b-9b5c-ced81f97db08.mp3','d463a45c-14e8-4070-bff5-2908d34ba7c3.mp3','2024년 10월 1일 꿀모닝 브리핑을 시작합니다.서울의 한 대형병원 응급의료센터에서 응급실 진료 지연과 의료개혁에 대한 대화가 이어졌지만, 여전히 의정갈등의 심화가 우려되고 있는 상황입니다. 이날 보건복지부와 서울대 의대 교수협의회 비상대책위원회는 오는 10일 오후 2시부터 4시까지 서울대 의대 융합관에서 \'의료개혁, 어디로 가는가\'를 주제로 토론회를 열 예정이라고 해요. 공개적인 의정 토론회는 드물기 때문에 많은 관심이 쏠리고 있어요. 이 자리를 통해 지속 가능한 의료체계 구축 방안에 대한 많은 질문이 정부에 전달될 것으로 예상되지만, 대한전공의협의회 등 의료계 일부 단체는 여전히 정부와의 대화에 부정적 반응을 보이고 있습니다. 또한 한국중증질환연합회는 9일 의대 5년제 정책이 갈등을 더욱 부추기고 있다며 중단할 것을 주장했습니다. 연합회는 정부와 의료계 간의 대립이 심화되고 있어 환자들이 상황을 견디기 어려운 지경에 이르렀다는 의견을 밝혔어요. 그들은 이번 갈등이 장기화되면서 심각한 의료 대란을 초래하고 있으며, 정부에 대한 신뢰가 크게 저하됐다고 비판했습니다. 이어서 한국어교원 관련 뉴스도 전해드리면, 직장갑질119 온라인노조추진위원회와 한국어교원협회가 진행한 조사에서 한국어교원의 약 55.4%가 월 200만 원 미만의 임금을 받으며, 많은 교원들이 쪼개기 계약으로 인해 실질적인 노동 조건이 열악하다는 사실이 드러났어요. 이들은 한국어 교육이 더 중요해졌음에도 불구하고 생계에 위협을 받고 있다고 토로하며, 지인에게 한국어교원을 추천하고 싶지 않다는 응답이 88.1%에 달했습니다. 이와 관련한 내용은 최근 열린 국회 토론회에서도 다루어졌습니다. 노동 조건 개선이 절실히 필요한 것으로 보이며, 여러 이해당사자의 목소리가 반영될 필요가 있겠네요.','2024년 10월 1일 꿀모닝 브리핑을 시작합니다. 서울의 한 대형병원에서 응급의료센터 환자가 의료개혁을 논의하는 자리에서 의정갈등의 심화에 대한 우려가 커지고 있어요. 보건복지부와 서울대 의대 교수협의회는 10일 오후 토론회를 열고 의료체계의 지속 가능성 등에 관한 질의를 할 예정입니다. 그러나 대한전공의협의회 등은 여전히 정부와 대화에 부정적인 입장을 보이고 있어요. 또한, 한국중증질환연합회는 의대 5년제 정책이 의료계 갈등을 부추기고 있다는 비판을 하며 이를 중단할 것을 촉구했습니다. 환자들이 의료 대란으로 고통받고 있는 상황에서 정부에 대한 신뢰가 떨어지고 있다고 강조했어요. 마지막으로, 한국어교원들의 노동 실태에 대한 설문조사 결과, 많은 교원들이 저임금과 불안정한 계약 문제로 어려움을 겪고 있다는 사실이 드러났습니다.'),(101,'2024-10-02 07:30:00.000000','2024-10-02 07:30:00.000000',1,'5a2addb1-a4ce-496f-b83d-30fac6a4eebb.mp3','516bfba5-5cd5-4712-9987-98fa51d73ca7.mp3','2024년 10월 2일 꿀모닝 브리핑을 시작합니다.오늘의 뉴스에서는 건강한 식단의 중요성과 국산 체외진단기기 업체들의 해외 시장 상황에 대한 내용을 다뤄보겠습니다. 균형 잡힌 식단에서 필수 영양소인 탄수화물은 자주 체중 증가와 같은 문제로 비난받곤 하지만, 최근 연구에 따르면 현베베베리처럼 정신을 맑게 해주는 식품으로 역할을 할 수 있다는 점이 주목받고 있습니다. 더불어, 오렌지는 비타민 C와 항산화 식물성 영양소가 풍부해 혈당 조절이 필요한 이들에게 좋은 선택이 됩니다. 자몽은 비타민 C와 항산화 성분이 풍부해 면역 체계에 도움을 주고 소화 건강에도 기여하죠. 사과는 유익한 항산화제와 섬유질로 건강에 유익하며, 바나나 또한 시력 유지와 심장 건강에 이로운 카로티노이드와 플라보노이드를 포함하고 있어 다양한 혜택을 제공한다고 합니다. 반면에, 국내 체외진단기기 업체들은 미국과 중국의 강력한 경쟁에 직면하여 해외 시장에서 새로운 활로를 모색하고 있습니다. 에스디바이오센서와 바디텍메드는 각각 해외에서 85%와 93%의 매출을 올리고 있지만, 아직도 많은 도전이 남아 있으며 중국 업체들의 가격 경쟁력이 큰 부담이 되고 있습니다. 손미진 수젠텍 대표는 한국 제품의 신뢰도가 여전히 중요한 요소라고 언급하면서도, 새로운 접근 방식이 필요하다고 강조했는데요. 코로나19 팬데믹 동안에는 해외 수출이 증가했지만, 정책적 지원은 부족했음을 지적했습니다. 이민전 웰스바이오 대표의 말에 따르면, 자국 제품 사용 환경 조성이 가장 필요하다고 하며, 정부 주도의 실증 사업이 늘어나야 시장 사용률을 높일 수 있다고 덧붙였습니다.','2024년 10월 2일 꿀모닝 브리핑을 시작합니다.이번 뉴스에서는 균형 잡힌 식단의 중요성과 국산 체외진단기기 업체들의 해외 시장 진출 현황에 대해 전해드릴게요. 연구에 따르면 탄수화물은 종종 부정적으로 여겨지지만, 현베베베리와 오렌지, 자몽은 건강에 많은 도움을 줄 수 있는 식품으로 알려졌습니다. 특히, 자몽은 강력한 면역 체계를 지원하고 소화를 돕는 효과가 있으며, 사과와 바나나도 비타민과 항산화 물질이 풍부해 기여하고 있습니다. 한편, 국내 체외진단기기 업체들이 선진국 및 중국의 강력한 경쟁 속에서 어려움을 겪고 있지만, 에스디바이오센서와 바디텍메드는 해외에서 상당한 매출을 기록하고 있습니다. 손미진 대표는 한국 제품의 신뢰도를 강조하며 새로운 시장 접근 방식이 필요하다고 언급했고, 정부의 정책적 지원도 절실하다고 하네요.'),(102,'2024-10-03 07:30:00.000000','2024-10-03 07:30:00.000000',1,'afa05d09-a6fd-4ca6-9e71-d05c93b66a64.mp3','7f0ccd13-f136-436b-b6ed-df0515cd8573.mp3','2024년 10월 3일 꿀모닝 브리핑을 시작합니다.안녕하세요 여러분, 오늘의 뉴스 브리핑을 시작하겠습니다. 미국의 바이든 대통령이 9일 오전 이스라엘 네타냐후 총리와 전화 통화를 통해 이란에 대한 보복 계획을 논의할 예정이라고 보도되었습니다. 군사 전문가들은 이스라엘이 이란의 핵 시설을 공격할 경우, 핵 시설이 위치한 나탄즈 지역의 농축 공장이 지하 25피트 깊이에 콘크리트로 보강되어 있어 공격이 쉽지 않을 것이라 전하고 있습니다. 또한, 이란과의 긴장이 고조됨에 따라 아랍 국가들이 중동 전선에서 휴전을 위해 물밑 협상을 시작했다고 합니다. 다만, 이스라엘은 지금까지 미국의 중재 노력에 불협화음을 내며 긴장 상황을 더욱 악화시켰다고 전해집니다. 헤즈볼라의 2인자인 나임 카셈은 휴전 합의가 성사될 경우 외교적 논의가 진행될 것이라 밝혔는데, 이는 헤즈볼라의 태도 변화로 해석되고 있어 국제 유가가 급락하는 결과를 가져왔습니다. 이와 함께, 바이든 대통령과 네타냐후 총리의 대화에서는 이란에 대한 상반된 의견이 드러날 가능성이 크다고 관측되고 있습니다. 좀 더 구체적으로, 미국 측의 이란 보복 계획과 관련된 논의에서 서로 다른 시각이 쟁점을 마련할 것으로 보입니다. 한편, 플로리다주에서는 허리케인 \'밀턴\'이 상륙할 가능성이 높아지면서 긴박한 상황이 이어지고 있으며, 대피 행렬이 이어지고 있습니다. 국립허리케인센터는 밀턴이 9일 늦은 오후 중서부 해안에 상륙하고 북동쪽으로 이동할 것이라고 경고했습니다. 앞서 지난달에는 4등급 허리케인 \'헐린\'이 남동부를 강타해 200명 이상의 사망자를 낳았고, 이는 오는 대선에도 영향을 미칠 것으로 예상됩니다. 정치적으로도 이번 허리케인은 사고 대처에서 중앙 정부와 지방 정부 간의 공조가 중요한 만큼, 디샌티스 플로리다 주지사가 비협조적인 태도를 보이고 있다는 보도도 있었습니다. 재난 대응이 정치적 변수로 작용할 수 있는 상황입니다. 이상으로 오늘의 종합적인 브리핑을 마치겠습니다.','2024년 10월 3일 꿀모닝 브리핑을 시작합니다.안녕하세요 여러분, 오늘 뉴스 브리핑을 시작하겠습니다. 미국의 바이든 대통령은 네타냐후 이스라엘 총리와 대화할 예정인데, 주된 논의는 이란의 핵 시설 공격 계획이라고 합니다. 이란과의 긴장이 고조되는 가운데, 아랍 국가들이 중동의 모든 전선에서 휴전을 위해 비밀 회담을 시작했다고 전해지고 있습니다. 이란과의 갈등이 심각해지자, 헤즈볼라 측에서 휴전 가능성을 언급하며 국제 유가는 급락세를 보이고 있습니다. 한편, 미국 플로리다에는 허리케인 \'밀턴\'이 가까워지고 있어 대피행렬이 이어지고 있으며, 이는 오는 대선에 영향을 미칠 것으로 보입니다. 이번 허리케인은 지난달 4등급 허리케인 \'헐린\'의 피해를 기억나게 하면서 정치적 파장도 예상되고 있습니다. 이상으로 간단한 브리핑을 마칩니다.'),(103,'2024-10-04 07:30:00.000000','2024-10-04 07:30:00.000000',1,'063a970c-a73b-4c6c-9305-66a54bf3a843.mp3','56d715f3-4b15-41b4-b523-87ad1b11011c.mp3','2024년 10월 4일 꿀모닝 브리핑을 시작합니다.최근 건강식품에 대한 관심이 높아지면서 여러 과일과 곡물의 효능이 다시금 주목받고 있는 가운데, 균형 잡힌 식단에서 필수 영양소로 알려진 탄수화물은 체중 증가와 당뇨병의 원인으로 비난받기도 했습니다. 그러나 오렌지는 비타민 C와 다양한 항산화 성분 덕분에 혈당을 모니터링하려는 분들에게 좋은 선택으로 알려지고 있고, 자몽 역시 면역력 강화와 소화 개선에 도움을 줄 수 있어 인기를 끌고 있습니다. 특히, 사과와 바나나도 각기 다른 건강상 이점을 제공하는 것으로 평가받고 있어요. 하지만 이러한 건강식품의 선호는 최근에도 꾸준히 이어지고 있으며, 각종 영양소가 균형 있게 포함된 식단이 건강을 지키는 데 중요하다는 것이 강조되고 있습니다. 한편, 국내 체외진단기기 업체들은 해외 시장에서의 경쟁력 저하로 어려움을 겪고 있는데, 선진국과 중국의 가격 경쟁력이 큰 영향을 미치는 것으로 나타났습니다. 에스디바이오센서와 바디텍메드는 해외 매출 비율이 높은 사례로 소개되었지만, 여전히 해외 시장에서 자리를 잡기에는 쉽지 않은 상황이에요. 특히, 세계 1위 체외진단업체인 로슈와의 매출 격차가 큼에 따라 경쟁력을 강화해야 할 필요성이 대두되고 있습니다. 이러한 가운데, 체외진단기기 업계 관계자들은 중국 업체들이 진출하지 않은 새로운 시장을 우선 공략하고, 신뢰성을 바탕으로 한국 제품의 장점을 부각시켜야 한다고 조언하고 있어요. 그리고, 코로나19 팬데믹 기간 동안 국내 업체들이 글로벌 수요에 빠르게 대응하며 성과를 올린 것은 긍정적 신호였지만, 정부의 정책적 지원이 부족했다는 점은 여전히 강조되고 있습니다. 산업 관계자들은 국내에서 자국 제품이 활발히 사용될 수 있는 환경 조성이 절실하며, 정부 주도의 실증 사업을 통해 시장 사용률을 높이는 것이 중요하다는 의견을 표하고 있습니다.','2024년 10월 4일 꿀모닝 브리핑을 시작합니다.최근 뉴스에 따르면 건강식품으로 알려진 다양한 과일과 곡물의 효능이 주목받고 있어요. 균형 잡힌 식단에서 탄수화물은 비난받기도 하지만, 오렌지와 자몽 같은 과일들은 혈당 조절에 좋은 선택이라는 연구 결과가 나왔어요. 또, 국내 체외진단기기 업체들은 선진국과 중국의 강력한 경쟁 속에서 해외 시장에서 활로를 모색하고 있는데, 특히 에스디바이오센서와 바디텍메드는 해외에서 높은 매출을 올리고 있어요. 하지만, 한국 제품이 가격 면에서는 불리함을 겪고 있죠. 이에 따라 체외진단기기 업계는 새로운 시장을 공략하고 제품 업그레이드에 집중해야 한다는 목소리가 나오고 있습니다.'),(104,'2024-10-05 07:30:00.000000','2024-10-05 07:30:00.000000',1,'effcfb3b-e8c6-4d67-b2a5-9845e0196000.mp3','0cfbed20-4c53-4a37-adb5-4bd20a5c9f41.mp3','2024년 10월 5일 꿀모닝 브리핑을 시작합니다.올해 노벨 화학상은 단백질 구조 예측의 혁신에 기여한 세 명의 과학자에게 돌아갔습니다. 미국 워싱턴대의 데이비드 베이커 교수와 구글 딥마인드의 허사비스 CEO, 그리고 점퍼 수석연구원이 이번 수상자로 선정되었습니다. 이들은 인공지능(AI)을 활용해 단백질 구조를 예측하는 분야에서 큰 성과를 거두었으며, 특히 베이커 교수는 \'로제타폴드\'라는 AI 모델을 개발하여 단백질 구조 해독을 몇 분에서 몇 시간 안에 가능하게 했습니다. 이는 제약바이오 업계에서 신약 개발에 혁신적인 변화를 가져올 것으로 전망되고 있습니다. 구글 딥마인드의 알파폴드는 17%에 불과했던 인체 단백질 구조 분석을 2억 개까지 늘려 놓았습니다. 또한 이로 인해 36만5000여 종의 단백질 3D 구조 예측이 가능해져 디지털 생물학의 새로운 시대가 여는 계기가 되었습니다. 이날 발표를 마친 후 세 명의 수상자는 총 1100만 크로나, 한화 약 14억3121만원의 상금을 나누게 됩니다. 한편, 국정감사에서는 통신 요금제와 제4 이동통신사 등 통신 현안에 대한 논의가 활발히 진행됐습니다. KT의 김영섭 대표는 LTE 요금제가 5G 요금제보다 비싸지는 역전 현상이 발생한 것에 대한 질의에 답하며 이러한 현상을 방지하기 위한 제도와 시스템을 개선하겠다고 밝혔습니다. 또한, 선택약정 미가입자가 전체 가입자의 26.2%인 1229만7811명에 달하는 것으로 나타나 이 제도가 유명무실하다는 지적도 있었습니다. 제4 이동통신사 후보인 스테이지엑스는 사업자 선정이 취소되었으며, 과기정통부는 연내에 관련 방침을 발표할 계획입니다. 이와 함께 김영섭 대표는 인터넷 데이터의 패킷 변조 혐의에 대해 재발 방지 조치를 약속했다고 전해집니다. 국감에서는 인터넷교통의 상당 부분을 차지하는 구글의 유료 서비스에 대한 우려도 나왔습니다.','2024년 10월 5일 꿀모닝 브리핑을 시작합니다.올해 노벨 화학상은 단백질 구조 예측에 기여한 세 명의 과학자에게 돌아갔습니다. 데이비드 베이커 교수와 구글 딥마인드의 허사비스 CEO, 점퍼 연구원이 수상자로 선정됐고, 이들의 연구는 단백질 구조 분석에 혁신을 가져올 것으로 기대됩니다. 특히, 알파폴드를 통해 2억 개의 단백질 구조가 확인됨으로써 제약바이오 산업에 큰 변화를 일으킬 전망입니다. 한편, 국정감사에서는 제4 이동통신사와 통신 요금제에 대한 논의가 활발히 진행되었고, 통신사 대표들은 제도 개선을 약속했습니다. 선택약정 미가입자가 1229만 명에 달한다는 지적도 있었고, 과기정통부는 제4 이동통신사 관련 방침을 연내 발표할 예정입니다.'),(105,'2024-10-06 07:30:00.000000','2024-10-06 07:30:00.000000',1,'0ae0d4fa-78a6-4722-a997-0ba2242cf970.mp3','43dee6c6-eb2a-40b1-ba86-b04f3cd6140e.mp3','2024년 10월 6일 꿀모닝 브리핑을 시작합니다.안녕하세요, 여러분. 어제 늦은 밤에 여러 가지 중요한 소식들이 있었습니다. 먼저, 10월 9일 \'문자의 날\'을 맞이하여 한국어의 아름다움과 한글의 고유성을 기념하는 행사에 대한 내용이 있었습니다. 이번 행사는 한글이 단순한 문자 이상의 의미를 지니고 있다는 것을 강조하며, 한글과 한국어의 구별이 필요하며 외국어와 한글의 관계에 대한 깊은 논의가 이어졌습니다. 많은 이들이 순수한 한국어 사용을 지향하지만, 과연 얼마나 그 기준을 지킬 수 있을지에 대한 고찰이 필요하다는 점이 강조되었습니다. 두 번째로, 강원도 인제군에서 열리고 있는 가을꽃 축제의 현장을 전하는 보도가 있었습니다. 이날의 날씨는 내륙 지역에서는 쾌청한 가을 날씨가 지속되었지만, 제주도는 남해상의 비구름 영향으로 비가 내렸습니다. 내일 날씨 정보에 따르면, 중부 서해안과 호남 서부에서 소량의 비가 예고되며, 강원과 충북, 영남 지역에는 안개가 짙게 끼어 자동차 운전 시 주의가 필요하다는 말씀이 있었습니다. 아침 기온은 서울 15도, 대전 13도로 예상되며 낮 최고 기온은 서울 22도, 대구 24도로 오늘과 유사한 수준을 유지할 것으로 보입니다. 마지막으로 균형 잡힌 식단에 관한 보도도 있었습니다. 탄수화물에 대한 우려가 있으나, 오히려 정신적 건강에 긍정적인 영향을 미치는 연구 결과들이 소개되었습니다. 오렌지와 자몽은 비타민 C와 다양한 항산화 성분들이 풍부하여 우리 몸에 긍정적인 영향을 주며, 바나나 또한 심장 건강을 증진시키는 여러 이점이 있다는 점이 강조되었습니다. 이처럼 다양한 소식들이 전달되었습니다. 여러분, 좋은 하루 되세요.','2024년 10월 6일 꿀모닝 브리핑을 시작합니다.안녕하세요, 여러분. 어제 늦은 밤, 여러 가지 흥미로운 뉴스가 있었습니다. 먼저, \'문자의 날\'을 맞아 한글과 한국어를 기념하는 행사에 관한 소식이 전해졌습니다. 한글의 본질적인 아름다움과 순수성을 강조하며, 외국어와의 구별 필요성이 대두되고 있다는 내용입니다. 이어서 가을꽃 축제가 열리고 있는 강원도 인제군의 날씨에 대한 보도가 있었습니다. 오늘 내륙 지역은 맑은 날씨를 보였지만, 제주도에서는 비가 내린다는 예보가 있었습니다. 내일은 중부와 호남 서부에 소량의 비가 예상되며, 강원과 충북, 영남 내륙에선 안개가 끼어 운전 시 주의가 필요하다는 경고가 있었습니다. 또한, 균형 잡힌 식단에 대한 논의도 있었는데, 탄수화물과 다양한 과일들이 건강에 미치는 긍정적인 효과에 대해 소개되었습니다. 특히 오렌지와 자몽, 바나나 등의 효능이 강조되었습니다.'),(106,'2024-10-07 07:30:00.000000','2024-10-07 07:30:00.000000',1,'8151fae9-fe14-4a73-acf9-a8128645fe22.mp3','0c93a0b9-3b15-4f2b-8811-5c8d26d74e93.mp3','2024년 10월 7일 꿀모닝 브리핑을 시작합니다.지난 9일, 부산의 한 초등학교에서 담임 교사의 교권 침해 문제가 논란이 되고 있습니다. 해당 교사는 수업 중 학생에게 집중하라는 말을 했고, 이를 통해 최근 3년간 담임 교사 교체가 두 배 이상 증가한 통계도 밝혀졌습니다. 2020년 54명에서 시작해 지난해에는 124명이 담임을 관뒀다고 합니다. 교사들의 업무는 과중해지는 반면 보상은 적고, 학부모의 과도한 개입이 문제가 되고 있는데요, 이로 인해 교사들이 교권 침해와 같은 스트레스에 시달리고 있다고 합니다. 한편, 로또 복권과 스피또 복권에서 20억 원에 당첨된 한 당첨자의 사연도 화제입니다. 그는 백종원 대표가 나타나 요리 레시피를 알려주는 꿈을 꾸고 당첨됐다고 전하며, 그 상황을 설명했습니다. 또한, 전주에서는 한 아파트 지하 주차장에서 충전 중이던 전기차가 화재를 일으켜 주민들이 긴급 대피하는 사태가 발생했습니다. 다행히 큰 인명 피해는 없었지만, 화재 원인에 대한 조사가 진행 중입니다. 65세 이상 주민등록 인구가 천만 명을 넘으며 노인 인구의 건강과 주거 환경이 중요해졌다는 연구 결과도 발표되었습니다. 이와 함께 현대인들이 건강한 간식을 섭취하도록 유도하는 캠페인도 시작되었는데, 당분과 칼로리가 높은 간식을 건강한 대체 식품으로 바꾸자는 내용입니다. 마지막으로, 이스라엘의 팔레스타인 공격이 계속 악화되고 있으며, 중동 상황에 대한 국제적 긴장도 높아지고 있습니다. 동시에 미국의 생화학자들이 단백질 구조 분석에 대한 혁신적인 기여를 인정받아 노벨 화학상을 수상하기로 결정되었습니다.','2024년 10월 7일 꿀모닝 브리핑을 시작합니다. 부산의 한 초등학교에서 교사의 교권 침해 문제가 불거졌습니다. 교사가 학생에게 집중하라는 채찍질을 했고, 전국적으로 담임 교사 교체가 급증하고 있다는 통계가 나왔습니다. 한편, 20억 복권에 당첨된 당첨자의 이야기가 화제인데, 꿈에서 유명 요리사 백종원을 만나 요리 레시피를 받았다고 합니다. 전주에서는 전기차 충전 중 화재가 발생해 주민들이 대피했으나 큰 피해는 없었습니다. 또한, 65세 이상 인구가 천만 명을 넘겼다는 통계와 함께 건강한 간식으로 바꾸자는 캠페인이 시작되었습니다. 마지막으로, 이스라엘과 레바논 간의 갈등이 심화되고 있으며, 과학 분야에서는 단백질 구조 분석에 획기적인 기여를 한 연구자들이 노벨상을 공동 수상하기로 결정되었습니다.'),(107,'2024-10-08 07:30:00.000000','2024-10-08 07:30:00.000000',1,'f8c556f5-14b3-4307-ae2c-1889d81a52d0.mp3','be1be736-dcca-4ce5-85f7-bba48271725a.mp3','2024년 10월 8일 꿀모닝 브리핑을 시작합니다.안녕하세요, 여러분. 오늘의 뉴스 브리핑을 시작하겠습니다. 먼저 기쁜 소식을 전해드리는데요, 한국이 세계 최대 선진채권 지수인 세계국채지수에 편입된다고 합니다. 이에 따라 약 2조5000억 달러의 자금이 유입될 것으로 예상되며, 한국금융연구원에 따르면 500억에서 600억 달러가 국채 시장에 들어간다면 0.2%에서 0.6%포인트의 금리 인하 효과를 가져올 것이라고 전망하고 있습니다. 기획재정부는 이번 지수 편입을 통해 국채 수요 기반이 확충되면서 안정적인 중장기 재정 운용이 가능할 것으로 보고 있다는 점도 주목할 만합니다. 한편, FTSE러셀은 계속해서 한국 증시에 \'선진시장\' 지위를 부여하고 있으며, 이는 한국 경제의 펀더멘털과 재정건전성, 그리고 자본시장 선진화에 대한 신뢰가 확인됐음을 의미한다고 분석했습니다. 다음으로 국내 증권가와 반도체 업계에서는 여전히 \'침체란 없다\'며 긍정적인 전망을 내놓고 있지만, 맥쿼리가 삼성전자의 투자의견을 \'중립\'으로 하향 조정했습니다. D램 등 메모리의 공급 과잉으로 인해 평균판매가격이 내림세를 보이고 있으며, 이로 인한 전방 산업 수요 위축이 실적에 부정적인 영향을 미칠 것이라는 우려도 커지고 있습니다. 송명섭 애널리스트는 반도체 업체의 주가가 하락한다는 것은 향후 6개월 후 업황이 나빠질 가능성이 있다는 경고를 하였고, 김동원 KB증권 센터장은 D램 시장 내 양극화가 향후 업황을 좌우할 것으로 예측했습니다. 마지막으로, 투자 전문가인 뢰벤탈 CIO는 유럽 주식 중 특히 에너지, 인프라, 부동산 관련 업종의 비중을 늘릴 계획이라고 밝혔습니다. 그는 글로벌 인플레이션 위험이 여전히 남아 있다고 강조하며, 일본 주식에 대한 투자 비중을 줄이고 현재 수익률 범위에서는 하이일드 채권의 매력도 낮아졌다고 전했습니다. 전문가들은 한국 주식이 저평가됐다고 해서 반드시 가격이 상승하는 것은 아니라고 지적하며, 중국의 경기 부양책이 실물 경기에 미치는 영향이 현실화되기까지는 일정 기간이 소요될 것이라고 조심스럽게 예측하고 있습니다. 이상으로 오늘의 브리핑을 마치겠습니다. 감사합니다.','2024년 10월 8일 꿀모닝 브리핑을 시작합니다.안녕하세요. 오늘의 주요 뉴스를 전해드리겠습니다. 한국이 세계 최대 선진채권 지수인 세계국채지수에 편입됩니다. 이는 약 2조5000억 달러 규모의 자금 유입이 예상되며, 국채자금이 500억에서 600억 달러 유입될 경우 금리 인하 효과도 기대된다고 하네요. 이어서 국내 증권가와 반도체 업계는 침체보다 긍정적인 전망을 내놓고 있지만, 삼성전자는 D램 공급 과잉으로 판매 가격이 하락할 것이라는 우려가 커지고 있습니다. 삼성전자에 대한 목표주가는 연일 낮아지고 있다고 합니다. 마지막으로 투자 전문가들은 인플레이션 위험 때문에 유럽 주식에 대한 비중을 늘리려는 방향으로 가고 있다고 하니 참고하시기 바랍니다.'),(108,'2024-10-09 07:30:00.000000','2024-10-09 07:30:00.000000',1,'7f528502-8d82-49c7-a91e-9a1d9a11ae40.mp3','a33040db-208d-46d0-8eb7-07132404b626.mp3','2024년 10월 9일 꿀모닝 브리핑을 시작합니다.어제의 주요 뉴스를 전해드리겠습니다. 부산의 한 초등학교에서는 담임 교사들이 어렵고 힘든 상황에 직면하고 있다는 소식이 있었습니다. 최근 3년 동안 스스로 담임을 사임한 교사들이 급증하고 있으며, 이로 인해 담임 교사들의 고충이 심화되고 있습니다. 지난해에는 124명이 자발적으로 직무를 내려놓았고, 전국적으로는 203명이 교체되었습니다. 교사들은 업무의 양과 저조한 수당, 그리고 학부모의 과도한 간섭으로 인해 큰 부담을 느끼고 있으며, 최근에는 아동 학대 우려로 신고를 당하기도 했습니다. 이에 따라 교사를 보호하는 방안이 시급히 필요하다는 목소리가 높아지고 있습니다. 한편, 복권에 관련한 재미있는 소식도 있었습니다. 한 당첨자는 꿈에서 백종원 대표가 자신의 요리법을 가르쳐줬다고 하며, 그 이후 20억원에 당첨된 이야기를 전했습니다. 그는 로또와 스피또를 주기적으로 구매해왔고, 아내와 함께 기쁨을 나누었으며 당첨금은 대출금을 상환하고 차량을 구매하는 데 사용할 계획이라고 밝혔습니다. 그리고 마지막 소식으로, 전라북도 전주의 한 아파트 지하 주차장에서 전기차가 충전 중 불이 나면서 주민들이 긴급히 대피했습니다. 화재가 발생했을 당시, 다행히 인명 피해는 없었고 소방당국이 신속하게 대응하여 불을 껐습니다. 다만, 기아의 \'니로\' 전기차가 충전 중 발생한 불이었고, 배터리 결함과 과충전 여부에 대한 조사가 필요한 상황입니다. 오늘의 뉴스는 여기까지입니다.','2024년 10월 9일 꿀모닝 브리핑을 시작합니다.어제 전해드릴 소식입니다. 부산의 한 초등학교에서 담임 교사들이 부담을 느끼고 있다는 소식이었습니다. 최근 3년 사이 담임 교사가 자발적으로 교체되는 사태가 증가했는데, 2022년에는 200명을 넘었으며 교권 문제가 대두되고 있습니다. 한편, 복권 역사상 독특한 사례가 있었습니다. 백종원 대표가 등장하는 꿈을 꾼 한 당첨자가 스피또 복권에 당첨되면서 20억원을 수령했습니다. 마지막으로, 전주 아파트 지하 주차장에서 전기차 화재가 발생해 주민들이 대피하는 일이 생겼습니다. 다행히 인명 피해는 없었지만 화재 원인은 조사가 필요할 것 같습니다.'),(109,'2024-10-10 07:30:00.000000','2024-10-10 07:30:00.000000',1,'630a8c4e-9806-4fb0-a956-27e7988342a9.mp3','4357e443-9b1d-4417-857f-3ba4c16c7929.mp3','2024년 10월 10일 꿀모닝 브리핑을 시작합니다.오늘은 정치와 국제 관계에서 주요한 소식들을 전해드리려고 해요. 먼저 국민의힘 한동훈 대표가 9일 오후 부산 금정구에서 윤일현 금정구청장 후보의 유세를 지원했습니다. 이번 유세는 10·16 재보궐선거를 대비한 것으로 보이는데, 지난 총선에서 국민의힘이 부산에서 큰 성과를 거둔 만큼 이번에도 그 기세를 이어가길 바라는 듯 해요. 그러나 최근 내부 갈등과 김건희 여사에 대한 의혹 등 악재로 인해 지지율이 하락하고 있는 상황에서 지역 주민들은 “정치인을 찍어도 바뀌는 게 없다”는 반응을 보이고 있어 조금 우려스러운 분위기가 감지되고 있습니다. 다음으로, 북한의 소식입니다. 북한은 9일 남측과의 연결 통로를 완전히 차단하고 영구적인 군사 담장을 쌓겠다고 발표하며 남북 간의 관계 단절을 공식화한 것으로 보입니다. 김정은 국무위원장이 남북을 적대적인 두 국가로 규정한 이후, 경의선과 동해선 도로에 지뢰를 심고 철도를 철거하는 등의 작업을 진행해왔고, 이제는 군사분계선 일대 방벽 건설과 같은 영구적인 조치를 실시하겠다는 거죠. 이는 최근 전쟁 위기 고조와 관련된 조치로 해석되고, 한국을 건너뛰고 미국에만 집중하겠다는 신호로 읽히고 있습니다. 마지막으로 국민의힘 김종인 전 비상대책위원장이 윤석열 대통령과 김건희 여사와의 첫 만남에 대해 설명했습니다. 김종인 전 위원장은 명태균 씨의 전화를 통해 두 사람을 만나게 됐다고 밝혔으며, 대선 경선 당시 많은 대화가 오갔던 점도 언급했어요. 이는 정치적 연대와 관련된 다양한 배경을 제공하며, 정치권 내에서 여러 이슈가 얽혀 있는 상황이 엿보입니다. 지금까지 정치와 국제 관계에 대한 소식들을 전해드렸습니다.','2024년 10월 10일 꿀모닝 브리핑을 시작합니다.오늘은 정치와 국제 관계에 관한 중요한 소식들을 전해드릴게요. 먼저, 국민의힘 한동훈 대표가 9일 부산 금정구에서 10·16 재보궐선거에 출마한 윤일현 후보의 유세를 지원했어요. 최근 여권 내 갈등과 김건희 여사 관련 의혹 등으로 인해 지지율이 하락하고 있는 상황에서, 지역 민심은 박빙의 결과를 보일 것이라는 의견이 많았답니다. 한편, 북한은 남측과의 연결 통로를 차단하고 영구적인 군사 담장을 쌓겠다고 발표했어요. 이는 김정은 국무위원장이 적대적 관계로 규정한 이후 남북 연결을 끊기 위한 조치로 해석되고 있는데, 한국을 건너뛰고 미국만 상대하겠다는 시그널로 분석된다고 하네요. 마지막으로 국민의힘 김종인 전 비상대책위원장이 윤석열 대통령과 그의 부인 김건희 여사와의 첫 만남에 대해 이야기했어요. 명태균 씨의 중개로 이뤄진 것으로 보이며, 다양한 정치적 대화가 오갔다는 언급도 있었어요.');
